import React, { useState } from 'react';
import axios from 'axios';
 
function CreateBooking() {
  const [bookingData, setBookingData] = useState({
    bookingDate: '',
    duration: 1,
    name: '',
    contactNumber: '',
    email: '',
    paymentAmount: 0,
    startTime: '',
    endTime: '',
    status: 'Upcoming',
    bookingType: '',
  });
  const [message, setMessage] = useState('');
 
  const handleSubmit = (event) => {
    event.preventDefault();
 
    // Validate the email domain
    if (!bookingData.email.endsWith('@cit.edu')) {
      setMessage('Invalid email domain. Use @cit.edu email.');
      return;
    }
 
    axios
      .post('/bookings/createBooking', bookingData)
      .then(() => {
        setMessage('Booking created successfully!');
        setBookingData({
          bookingDate: '',
          duration: 1,
          name: '',
          contactNumber: '',
          email: '',
          paymentAmount: 0,
          startTime: '',
          endTime: '',
          status: 'Upcoming',
          bookingType: '',
        });
      })
      .catch((error) => {
        setMessage('Error creating booking');
        console.error(error);
      });
  };
 
  const styles = {
    container: {
      backgroundImage: "url('/bookingbg.jpg')", // Background image
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      minHeight: '100vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      padding: '20px', // Add padding for better spacing
    },
    formContainer: {
      backgroundColor: 'rgba(255, 255, 255, 0.95)', // Light semi-transparent white
      padding: '30px',
      borderRadius: '12px',
      width: '100%',
      maxWidth: '500px', // Increased max width
      boxShadow: '0 8px 20px rgba(0, 0, 0, 0.3)', // Enhanced shadow
      textAlign: 'center',
    },
    title: {
      marginBottom: '20px',
      fontSize: '1.8rem',
      fontWeight: 'bold',
      color: '#333',
    },
    subtitle: {
      marginBottom: '10px',
      fontSize: '1rem',
      color: '#555',
    },
    input: {
      width: '100%',
      padding: '12px',
      margin: '10px 0',
      borderRadius: '8px',
      border: '1px solid #ccc',
      fontSize: '1rem',
    },
    button: {
      width: '100%',
      padding: '12px',
      backgroundColor: '#28a745', // Green color
      color: 'white',
      border: 'none',
      borderRadius: '8px',
      fontSize: '1rem',
      fontWeight: 'bold',
      cursor: 'pointer',
      marginTop: '15px',
      transition: 'all 0.3s ease',
    },
    buttonHover: {
      backgroundColor: '#218838',
    },
    message: {
      marginTop: '15px',
      color: '#4caf50', // Success green
      textAlign: 'center',
    },
  };
 
  return (
<div style={styles.container}>
<div style={styles.formContainer}>
<h2 style={styles.title}>Create Booking</h2>
<p style={styles.subtitle}>
<strong>Function:</strong> This function allows users to create a new booking.
</p>
<form onSubmit={handleSubmit}>
<input
            type="text"
            placeholder="Enter Name or ID"
            value={bookingData.name}
            onChange={(e) => setBookingData({ ...bookingData, name: e.target.value })}
            style={styles.input}
            required
          />
<input
            type="tel"
            placeholder="Enter Contact Number"
            value={bookingData.contactNumber}
            onChange={(e) => setBookingData({ ...bookingData, contactNumber: e.target.value })}
            style={styles.input}
            required
          />
<input
            type="email"
            placeholder="Enter Email (@cit.edu only)"
            value={bookingData.email}
            onChange={(e) => setBookingData({ ...bookingData, email: e.target.value })}
            style={styles.input}
            required
          />
<input
            type="number"
            placeholder="Enter Payment Amount"
            value={bookingData.paymentAmount}
            onChange={(e) => setBookingData({ ...bookingData, paymentAmount: parseFloat(e.target.value) })}
            style={styles.input}
            min="0"
            required
          />
<input
            type="date"
            value={bookingData.bookingDate}
            onChange={(e) => setBookingData({ ...bookingData, bookingDate: e.target.value })}
            style={styles.input}
            required
          />
<input
            type="time"
            value={bookingData.startTime}
            onChange={(e) => setBookingData({ ...bookingData, startTime: e.target.value })}
            style={styles.input}
            required
          />
<input
            type="time"
            value={bookingData.endTime}
            onChange={(e) => setBookingData({ ...bookingData, endTime: e.target.value })}
            style={styles.input}
            required
          />
<select
            value={bookingData.bookingType}
            onChange={(e) => setBookingData({ ...bookingData, bookingType: e.target.value })}
            style={styles.input}
            required
>
<option value="" disabled>
              Select Booking Type
</option>
<option value="Room">Room</option>
<option value="Equipment">Equipment</option>
<option value="Event">Event</option>
<option value="Other">Other</option>
</select>
<button
            type="submit"
            style={styles.button}
            onMouseEnter={(e) => (e.target.style.backgroundColor = '#218838')}
            onMouseLeave={(e) => (e.target.style.backgroundColor = '#28a745')}
>
            Create Booking
</button>
</form>
        {message && <p style={styles.message}>{message}</p>}
</div>
</div>
  );
}
 
export default CreateBooking;
